from main import addSingleCarToDB, connectionInit
from fake_headers import Headers
from bs4 import BeautifulSoup
import requests

def getAllCarsFromSubpage(subpageUrl:str) -> list:
    outputUrls = list()
    pageIter = 1
    while True:
        header = Headers().generate()
        selPage = requests.get(subpageUrl + f"page{pageIter}/")
        soup = BeautifulSoup(selPage.content, "lxml")
        detectedAds = soup.find_all("a", class_="css-1ctbluq ewrty961", href=True)
        if detectedAds:
            outputUrls += [i['href'] for i in detectedAds]
            pageIter += 1
        else:
            break
    return outputUrls


